  outputs.name = responseObject.name;
  outputs.release_year = responseObject.year;
  outputs.num_parts = responseObject.num_parts;
  outputs.theme_id = responseObject.theme_id;
  outputs.set_img_url = responseObject.set_img_url;
  outputs.set_url = responseObject.set_url;
  outputs.last_modified_dt = responseObject.last_modified_dt;
  outputs.set_num = responseObject.set_num
})(inputs, outputs);

